def build_network(n, m):
    if m <= n:
        return (-1, -1)
    if n == 2:
        return (-1, -1)
    elif n == 3 or n == 4:
        if n == m:
            connections = [(i, i + 1) for i in range(1, n)]
            connections.append((n, 1))
            return connections
        else:
            return (-1, -1)
    else:
        diff = n - 4
        omen = diff + n
        if m > omen:
            return (-1, -1)
        else:
            temp = m - n
            temp = n - temp
            connections = [(i, i + 1) for i in range(1, temp)]
            connections.append((temp, 1))
            if m - n:
                for i in range(temp + 1, n + 1):
                    connections.append((i, 1))
                    connections.append((i, 3))
            return connections

